/**
 * spec document for RtlRenderer.ts class
 */
import { RtlRenderer, PdfTrueTypeFont,RectangleF,PdfStringFormat } from "../../../../../src/index";

describe('RtlRenderer.ts', () => {
    describe('Constructor initializing',()=> {
        let t1 : RtlRenderer = new RtlRenderer();
        let Arialttf : string ="";
        let font = new PdfTrueTypeFont(Arialttf,12);
        let t11 : string ;
        let t2 :string[]= [];
        let t3 : { success : boolean, glyphs : Uint16Array };
        let text : string = "hello";
        let rect : RectangleF = new RectangleF(0, 0, 515 ,762);
        let format : PdfStringFormat =new PdfStringFormat();
        it('-text == null', () => {
            expect(function():void{t2 = t1.layout(null, font,false ,false,format) }).toThrowError();
        })
        it('-font == null', () => {
            expect(function():void{t2 = t1.layout(text, null,false ,false,format) }).toThrowError();
        })
        it('-text == null', () => {
            expect(function():void{t2 = t1.splitLayout(null, font,false ,false,format) }).toThrowError();
        })
        it('-font == null', () => {
            expect(function():void{t2 = t1.splitLayout(text, null,false ,false,format) }).toThrowError();
        })
        it('-text == null', () => {
            expect(function():void{t3 = t1.getGlyphIndex(null, font,false ,null,null) }).toThrowError();
        })
        it('-font == null', () => {
            expect(function():void{t3 = t1.getGlyphIndex(text, null,false ,null,null) }).toThrowError();
        })
        it('-text == null', () => {
            expect(function():void{t11 = t1.customLayout(null,false ,format) }).toThrowError();
        })
        it('-text == null', () => {
            expect(function():void{t2 = t1.customLayout(null, false ,format, font,false) }).toThrowError();
        })
        it('-font == null', () => {
            expect(function():void{t2 = t1.customLayout(text, false ,format, null,false) }).toThrowError();
        })
        it('-text == null', () => {
            expect(function():void{t11 = t1.addChars(font, null) }).toThrowError();
        })
        it('-font == null', () => {
            expect(function():void{t11 = t1.addChars(null, text) }).toThrowError();
        })
        it('-text == null', () => {
            expect(function():void{t2 = t1.customSplitLayout(null, font,false ,false,format) }).toThrowError();
        })
        it('-font == null', () => {
            expect(function():void{t2 = t1.customSplitLayout(text, null,false ,false,format) }).toThrowError();
        })
    })
})